 INSERT INTO `dd_indexnews` VALUES ('10','2','善用香港优势开拓海外市场','善用香港優勢開拓海外市場','<p style=\"text-indent:28px;font-size:14px;color:#2B2B2B;font-family:simsun, arial, helvetica, clean, sans-serif;background-color:#FFFFFF;\">
	投资推广署是香港特别行政区政府属下部门，专责为香港促进外来直接投资，致力协助海外及内地企业在香港开设和拓展业务。本署致力引进有助香港经济发展的外来投资，并鼓励这些投资项目留港发展。自2000年成立以来，投资推广署协助了全球数以千计的公司在香港发展业务。本署以热诚态度、重视诚信、专业服务、方便营商、以及迅速回应为原则，应企业的需要提供服务。
</p>
<p style=\"text-indent:28px;font-size:14px;color:#2B2B2B;font-family:simsun, arial, helvetica, clean, sans-serif;background-color:#FFFFFF;\">
	投资推广署通过推广、促进工作及后续支持服务等多方面的工作，为海外及内地的企业家提供全面、免费而保密的服务，以增加他们对香港营商环境的认识，让企业家有更强的信心在香港设点。
</p>
<p style=\"text-indent:28px;font-size:14px;color:#2B2B2B;font-family:simsun, arial, helvetica, clean, sans-serif;background-color:#FFFFFF;\">
	一家企业在决定前往香港设点前需要做很多市场调研的工作。投资推广署可免费为企业家提供最新的信息，包括香港经济资料、法律条例、税务与会计制度、雇佣条例、租金与工资水平、行业分析等；让企业家准确地评估商业前景，做出正确的投资决定。
</p>
<p style=\"text-indent:28px;font-size:14px;color:#2B2B2B;font-family:simsun, arial, helvetica, clean, sans-serif;background-color:#FFFFFF;\">
	投资推广署设有不同的行业服务小组，专门服务来自不同行业的企业。如果企业决定前往香港开业，也就是投资中期阶段的时候，投资推广署提供的辅助服务包括介绍可靠的中介机构，如会计师、律师、地产代理，协助申请行业牌照、行政人员工作签证、公司注册、商业登记、办公室租赁、员工招聘等。
</p>
<p style=\"text-indent:28px;font-size:14px;color:#2B2B2B;font-family:simsun, arial, helvetica, clean, sans-serif;background-color:#FFFFFF;\">
	为配合国家鼓励企业“走出去”的政策，投资推广署已投放更多资源在内地市场，分别在北京、广州、上海、成都及武汉派驻投资推广组。<span style=\"color:#2B2B2B;font-family:simsun, arial, helvetica, clean, sans-serif;font-size:14px;line-height:24px;background-color:#FFFFFF;\">武汉投资推广组于2014年7月成</span><span style=\"line-height:24px;\">立，服务范围包括湖北、湖南、河南、江西及山西五省。武汉投资推广组自成立后，主动联系服务范围内的相关政府机构以及各行各业的大小企业，安排了超过150次的会议与拜访；并积极参与和举办多项活动，例如，投资推广署在2014年10月28日应宜昌市商务局邀请，担任其主办的中小企业融资讲座的演讲嘉宾。2015年1月28日与香港特別行政区政府驻武汉经济贸易办事处合办了春节招待酒会，为湖北商界与在鄂港商提供交流机会。在2015年3月5日及6日，投资推广署分别于武汉及郑州举办投资推广研讨会，为湖北及河南的企业带来香港税制、金融服务、营商环境以及出入境政策的最新资讯，并鼓励两地的企业通过香港，走向国际。</span><span style=\"color:#2B2B2B;font-family:simsun, arial, helvetica, clean, sans-serif;font-size:14px;line-height:24px;background-color:#FFFFFF;\">
	<p style=\"text-indent:28px;font-size:14px;color:#2B2B2B;font-family:simsun, arial, helvetica, clean, sans-serif;background-color:#FFFFFF;\">
		在香港开业过程便捷简易，加上投资推广署提供的免费、专项及保密的服务及协助，一切将更轻松自在。投资推广署在香港总部、驻内地及驻海外的团队合作无间，努力协助客户在本港开业或拓展业务。<span style=\"color:#2B2B2B;font-family:simsun, arial, helvetica, clean, sans-serif;font-size:14px;line-height:21px;background-color:#FFFFFF;\">投资推广署</span>与客户保持长远的伙伴关系，无论客户的业务发展至任何阶段，<span style=\"color:#2B2B2B;font-family:simsun, arial, helvetica, clean, sans-serif;font-size:14px;line-height:21px;background-color:#FFFFFF;\">投资推广署</span>都能提供相应的协助。
	</p>
<br />
</span>
</p>','<span style=\"font-size:14px;\">&nbsp; &nbsp; &nbsp; &nbsp;投資推廣署是香港特別行政區政府屬下部門，專責為香港促進外來直接投資，致力協助海外及內地企業在香港開設和拓展業務。本署致力引進有助香港經濟發展的外來投資，並鼓勵這些投資項目留港發展。自2000年成立以來，投資推廣署協助了全球數以千計的公司在香港發展業務。本署以熱誠態度、重視誠信、專業服務、方便營商、以及迅速回應為原則，應企業的需要提供服務。</span><br />
<span style=\"font-size:14px;\">&nbsp; &nbsp; &nbsp; &nbsp;投資推廣署通過推廣、促進工作及後續支持服務等多方面的工作，為海外及內地的企業家提供全面、免費而保密的服務，以增加他們對香港營商環境的認識，讓企業家有更強的信心在香港設點。</span><br />
<span style=\"font-size:14px;\">壹家企業在決定前往香港設點前需要做很多市場調研的工作。投資推廣署可免費為企業家提供最新的信息，包括香港經濟資料、法律條例、稅務與會計制度、雇傭條例、租金與工資水平、行業分析等；讓企業家準確地評估商業前景，做出正確的投資決定。</span><br />
<span style=\"font-size:14px;\">&nbsp; &nbsp; &nbsp; &nbsp;投資推廣署設有不同的行業服務小組，專門服務來自不同行業的企業。如果企業決定前往香港開業，也就是投資中期階段的時候，投資推廣署提供的輔助服務包括介紹可靠的中介機構，如會計師、律師、地產代理，協助申請行業牌照、行政人員工作簽證、公司註冊、商業登記、辦公室租賃、員工招聘等。</span><br />
<span style=\"font-size:14px;\">&nbsp; &nbsp; &nbsp; &nbsp;為配合國家鼓勵企業“走出去”的政策，投資推廣署已投放更多資源在內地市場，分別在北京、廣州、上海、成都及武漢派駐投資推廣組。武漢投資推廣組於2014年7月成立，服務範圍包括湖北、湖南、河南、江西及山西五省。武漢投資推廣組自成立後，主動聯系服務範圍內的相關政府機構以及各行各業的大小企業，安排了超過150次的會議與拜訪；並積極參與和舉辦多項活動，例如，投資推廣署在2014年10月28日應宜昌市商務局邀請，擔任其主辦的中小企業融資講座的演講嘉賓。2015年1月28日與香港特別行政區政府駐武漢經濟貿易辦事處合辦了春節招待酒會，為湖北商界與在鄂港商提供交流機會。在2015年3月5日及6日，投資推廣署分別於武漢及鄭州舉辦投資推廣研討會，為湖北及河南的企業帶來香港稅制、金融服務、營商環境以及出入境政策的最新資訊，並鼓勵兩地的企業通過香港，走向國際。</span><br />
<span style=\"font-size:14px;\">&nbsp; &nbsp; &nbsp; &nbsp;在香港開業過程便捷簡易，加上投資推廣署提供的免費、專項及保密的服務及協助，壹切將更輕松自在。投資推廣署在香港總部、駐內地及駐海外的團隊合作無間，努力協助客戶在本港開業或拓展業務。投資推廣署與客戶保持長遠的夥伴關系，無論客戶的業務發展至任何階段，投資推廣署都能提供相應的協助。</span><br />','','','','0','2015-04-09 20:24:01');/* MySQLReback Separation */
