 INSERT INTO `dd_indexnews` VALUES ('11','2','香港：企业走向世界的前沿阵地','香港：企業走向世界的前沿陣地','<p style=\"font-size:16px;text-indent:2em;color:#252525;font-family:宋体, sans-serif;text-align:justify;background-color:#FFFFFF;\">
	香港获国内外公认的全球最有利营商的城市之一。香港的地理位置优越、基建先进、法制完善、经济自由，不断吸引着国内外企业、资金、人才到来。
</p>
<p style=\"font-size:16px;text-indent:2em;color:#252525;font-family:宋体, sans-serif;text-align:justify;background-color:#FFFFFF;\">
	据世界银行的《2015年全球营商环境报告》显示，香港在便利营商排名表上位居全球第三位。美国智库密尔肯研究院2013年发布的《全球机会指数》把香港评选为对外来直接投资最具吸引力的经济体。多年来，香港一直获传统基金会和菲沙研究所评选的全球最自由的经济体。《商旅》杂志（亚太版）的2014年度读者调查再次选出香港为“全球最佳商务城市”。
</p>
<p style=\"font-size:16px;text-indent:2em;color:#252525;font-family:宋体, sans-serif;text-align:justify;background-color:#FFFFFF;\">
	这使香港拥有强大的竞争力。中国社会科学院2014年发表的研究报告中，继续把香港评为中国最具综合竞争力的城市。瑞士洛桑国际管理发展学院2014年发表的《世界竞争力年报》，把香港的竞争力评为全球第四位，并在亚洲排名第二。
</p>
<p style=\"font-size:16px;text-indent:2em;color:#252525;font-family:宋体, sans-serif;text-align:justify;background-color:#FFFFFF;\">
	国际企业为此纷纷选择香港作为进入中国内地和亚洲庞大市场的“桥头堡”，并到香港设立办事处。这既带来资金，也创造高增值职位，并同时带来不同领域的人才、新的管理文化及崭新的技术，进一步使香港荟萃中西文化，迸发出新创意。
</p>
<p style=\"font-size:16px;text-indent:2em;color:#252525;font-family:宋体, sans-serif;text-align:justify;background-color:#FFFFFF;\">
	对于内地企业，香港同样是扩展业务的重要地方。
</p>
<p style=\"font-size:16px;text-indent:2em;color:#252525;font-family:宋体, sans-serif;text-align:justify;background-color:#FFFFFF;\">
	香港拥有大量熟悉中国文化和国际商务的人才，是内地企业打进国际市场的理想前沿阵地。香港凭着对国际和内地状况的了解，可以充当内地企业与世界之间的“超级联系人”，让内地企业在“走向世界”中事半功倍。香港一向是内地企业寻求新意念、正面经验和信息的源泉，未来也将如此。
</p>
<p style=\"font-size:16px;text-indent:2em;color:#252525;font-family:宋体, sans-serif;text-align:justify;background-color:#FFFFFF;\">
	<p style=\"font-size:16px;text-indent:2em;color:#252525;font-family:宋体, sans-serif;text-align:justify;background-color:#FFFFFF;\">
		香港作为中国的国际金融中心，能为中国企业提供融资平台。香港是内地企业最大的资金来源，内地企业到香港上市有助提升国际知名度和公司管治水平。截至2015年2月底，共有891家内地企业在香港上市，市值约159775亿元，占香港上市公司总市值的60.9%。香港特区政府将继续在各个范畴加强与内地的联系，并支持内地公司在香港开设业务。
	</p>
	<p style=\"font-size:16px;text-indent:2em;color:#252525;font-family:宋体, sans-serif;text-align:justify;background-color:#FFFFFF;\">
		《内地与香港关于建立更紧密经贸关系的安排》（CEPA）是香港与内地签订的自由贸易协议，为香港的服务提供商在内地带来庞大的机遇。在2014年11月推出的“沪港通”计划，是中央政府支持香港作为国际金融中心的最新例证。它把两地的资本市场直接联系起来，对香港和内地资本市场未来的合作发展具有重大历史意义。它将促进内地与国际股票市场的接轨，巩固香港作为最大离岸人民币业务枢纽和内地与国外之间“超级联系人”的地位。<span style=\"line-height:1.5;\"></span>
	</p>
</p>','<span style=\"font-size:14px;\">&nbsp; &nbsp; 香港獲國內外公認的全球最有利營商的城市之壹。香港的地理位置優越、基建先進、法制完善、經濟自由，不斷吸引著國內外企業、資金、人才到來。</span><br />
<span style=\"font-size:14px;\">&nbsp; &nbsp; 據世界銀行的《2015年全球營商環境報告》顯示，香港在便利營商排名表上位居全球第三位。美國智庫密爾肯研究院2013年發布的《全球機會指數》把香港評選為對外來直接投資最具吸引力的經濟體。多年來，香港壹直獲傳統基金會和菲沙研究所評選的全球最自由的經濟體。《商旅》雜誌（亞太版）的2014年度讀者調查再次選出香港為“全球最佳商務城市”。</span><br />
<span style=\"font-size:14px;\">&nbsp; &nbsp; </span><span style=\"font-size:14px;\">這使香港擁有強大的競爭力。中國社會科學院2014年發表的研究報告中，繼續把香港評為中國最具綜合競爭力的城市。瑞士洛桑國際管理發展學院2014年發表的《世界競爭力年報》，把香港的競爭力評為全球第四位，並在亞洲排名第二。</span><br />
<span style=\"font-size:14px;\">&nbsp; &nbsp; 國際企業為此紛紛選擇香港作為進入中國內地和亞洲龐大市場的“橋頭堡”，並到香港設立辦事處。這既帶來資金，也創造高增值職位，並同時帶來不同領域的人才、新的管理文化及嶄新的技術，進壹步使香港薈萃中西文化，迸發出新創意。</span><br />
<span style=\"font-size:14px;\">&nbsp; &nbsp;&nbsp;</span><span style=\"font-size:14px;\">對於內地企業，香港同樣是擴展業務的重要地方。</span><br />
<span style=\"font-size:14px;\">&nbsp; &nbsp; 香港擁有大量熟悉中國文化和國際商務的人才，是內地企業打進國際市場的理想前沿陣地。香港憑著對國際和內地狀況的了解，可以充當內地企業與世界之間的“超級聯系人”，讓內地企業在“走向世界”中事半功倍。香港壹向是內地企業尋求新意念、正面經驗和信息的源泉，未來也將如此。</span><br />
<span style=\"font-size:14px;\">&nbsp; &nbsp; 香港作為中國的國際金融中心，能為中國企業提供融資平臺。香港是內地企業最大的資金來源，內地企業到香港上市有助提升國際知名度和公司管治水平。截至2015年2月底，共有891家內地企業在香港上市，市值約159775億元，占香港上市公司總市值的60.9%。香港特區政府將繼續在各個範疇加強與內地的聯系，並支持內地公司在香港開設業務。</span><br />
<span style=\"font-size:14px;\">&nbsp; &nbsp;</span><span style=\"font-size:14px;\">《內地與香港關於建立更緊密經貿關系的安排》（CEPA）是香港與內地簽訂的自由貿易協議，為香港的服務提供商在內地帶來龐大的機遇。在2014年11月推出的“滬港通”計劃，是中央政府支持香港作為國際金融中心的最新例證。它把兩地的資本市場直接聯系起來，對香港和內地資本市場未來的合作發展具有重大歷史意義。它將促進內地與國際股票市場的接軌，鞏固香港作為最大離岸人民幣業務樞紐和內地與國外之間“超級聯系人”的地位。</span><br />','','','','0','2015-04-09 20:28:23');/* MySQLReback Separation */
