 INSERT INTO `dd_indexnews` VALUES ('12','2','六大理财宝典如何成就一代富豪','六大理財寶典如何成就壹代富豪','<p style=\"font-family:宋体, Arial, sans-serif;font-size:16px;background-color:#FFFFFF;text-indent:2em;\">
	在博鳌亚洲论坛最后一天，也就是3月29日，上演了一场压轴大戏，由百度的首席执行官李彦宏客串主持人，采访了微软的创始人比尔盖茨和Space X创始人马斯克。由于这三人的身价，被外界评论是价值超过了千亿人民币的对话。有人说世界的是不公平的，就是有人形象好气质佳，又有钱。但是嘉丰瑞德理财师认为，世界上没有绝对的公平，我们要做的就是磨练自己，给自己的成功创造更多的潜在可能。
</p>
<p style=\"font-family:宋体, Arial, sans-serif;font-size:16px;background-color:#FFFFFF;text-indent:2em;\">
	据在现场的记者说，原本以为这三个人会聊点技术话题，结果他们却在大聊人生和理想。这些扯皮在别人那儿也许毫无意义，但是由于是这三个人，所以显得非常珍贵及牛逼。
</p>
<p style=\"font-family:宋体, Arial, sans-serif;font-size:16px;background-color:#FFFFFF;text-indent:2em;\">
	一、白手起家的阶段好好积累资本金
</p>
<p style=\"font-family:宋体, Arial, sans-serif;font-size:16px;background-color:#FFFFFF;text-indent:2em;\">
	由于上文提到的三个人本身资金实力都比较雄厚，所以不在一个起跑线上的，白手起家的人，首先要做的就是积累资本金，努力工作，通过理财拿到原始的第一桶金。比如在初始阶段可以投资一些类似于宜盛月定投这样的年化收益率为6.8%的理财产品，然后我们可以继续投资年化收益率在10%左右的宜盛宝，这类理财产品周期大约在一年左右，进可攻退可守，就按照这样的节奏积累几年，也就是积累到了第一桶金。当然，最关键的还是要努力工作，使自己具备更多的竞争力。
</p>
<p style=\"font-family:宋体, Arial, sans-serif;font-size:16px;background-color:#FFFFFF;text-indent:2em;\">
	二、攒够了资本金，即使只有10%的成功可能，也要去做
</p>
<p style=\"font-family:宋体, Arial, sans-serif;font-size:16px;background-color:#FFFFFF;text-indent:2em;\">
	这句话的原话是来自马斯克。“就像比尔·盖茨先生所讲到的，其实一开始我没有预想我要做这么庞大的事情。只要这件事有10%的成功率，我就去做，现在做特斯拉也是这样，我一开始做电动车的时候，人们都劝我说，开汽车公司都是傻子，开电动汽车的公司是傻子中的战斗机，但我们依然没有停止，依然尝试了很多次。”
</p>
<p style=\"font-family:宋体, Arial, sans-serif;font-size:16px;background-color:#FFFFFF;text-indent:2em;\">
	三、精神世界的修为和资本的积累一样重要
</p>
<p style=\"font-family:宋体, Arial, sans-serif;font-size:16px;background-color:#FFFFFF;text-indent:2em;\">
	“人丑就要多读书”嘉丰瑞德理财师认为，不丑也要多读书。世界上多的是比你美，还比你更爱读书的人，精神世界的层次决定了你的层次。所谓人要往上爬就是这个道理，“土财主”之所以“土”，发了财还得不到尊敬，就是因为他精神层面所在的层次不足以支撑他的财富，所以说呢，提高精神层次的最直白的方式还是读书，不管怎样都要读书，忙里偷闲也要读书，凿壁借光、悬梁刺股都要读书。
</p>
<p style=\"font-family:宋体, Arial, sans-serif;font-size:16px;background-color:#FFFFFF;text-indent:2em;\">
	四、学会创新，等待机遇
</p>
<p style=\"font-family:宋体, Arial, sans-serif;font-size:16px;background-color:#FFFFFF;text-indent:2em;\">
	大佬们其实也谈了谈具体业务，马斯克说到他的无人驾驶汽车，说从技术角度来说，无人驾驶汽车两到三年之后，就会比有人驾驶更安全；大规模量产的话，五年之后就可以实现。但要让无人驾驶被主流人群接受，还必须有政府相关法规的支持。但是在此之前，这种蕴含着无限可能的技术依然会被不断地改进。
</p>
<p style=\"font-family:宋体, Arial, sans-serif;font-size:16px;background-color:#FFFFFF;text-indent:2em;\">
	五、起得早，养成良好的习惯
</p>
<p style=\"font-family:宋体, Arial, sans-serif;font-size:16px;background-color:#FFFFFF;text-indent:2em;\">
	对话结束时，才不到早上八点半！有人就说了，世界上最可怕的事发生了，大佬们7点就开始聊未来了！其实大佬们的作息习惯都非常好，日子过得很有纪律性，不会赖床，不会晚上打游戏到半夜，虽然胡适大师留下了“7月13日，打牌；7月14日，打牌…7月16日，胡适啊你不能再堕落了；7月17日，打牌；7月18日，打牌”的日记，但是据嘉丰瑞德理财师实地翻开胡适日记考证，胡适大师打牌只是消遣，人家还是把该做的事情都做完了再去打牌的，囧。今日事今日毕，不能给拖延症可趁之机。
</p>
<p style=\"font-family:宋体, Arial, sans-serif;font-size:16px;background-color:#FFFFFF;text-indent:2em;\">
	六、学会感恩和回馈
</p>
<p style=\"font-family:宋体, Arial, sans-serif;font-size:16px;background-color:#FFFFFF;text-indent:2em;\">
	嘉丰瑞德理财师认为，比尔盖茨算是一个格局非常大的人，知道力量越大责任越大，所以他能说出“当我在二十多岁的时候，应该不会因为做慈善而有多大的满足感，毕竟那时候中国记得更多的是微软本身，从现在这个阶段来说，我觉得我可以做出最大的贡献，都是通过慈善基金(微博)会来实现的。”
</p>','&nbsp; &nbsp;在博鰲亞洲論壇最後壹天，也就是3月29日，上演了壹場壓軸大戲，由百度的首席執行官李彥宏客串主持人，采訪了微軟的創始人比爾蓋茨和Space X創始人馬斯克。由於這三人的身價，被外界評論是價值超過了千億人民幣的對話。有人說世界的是不公平的，就是有人形象好氣質佳，又有錢。但是嘉豐瑞德理財師認為，世界上沒有絕對的公平，我們要做的就是磨練自己，給自己的成功創造更多的潛在可能。<br />
&nbsp; &nbsp;據在現場的記者說，原本以為這三個人會聊點技術話題，結果他們卻在大聊人生和理想。這些扯皮在別人那兒也許毫無意義，但是由於是這三個人，所以顯得非常珍貴及牛逼。<br />
&nbsp; &nbsp;壹、白手起家的階段好好積累資本金<br />
&nbsp; &nbsp;由於上文提到的三個人本身資金實力都比較雄厚，所以不在壹個起跑線上的，白手起家的人，首先要做的就是積累資本金，努力工作，通過理財拿到原始的第壹桶金。比如在初始階段可以投資壹些類似於宜盛月定投這樣的年化收益率為6.8%的理財產品，然後我們可以繼續投資年化收益率在10%左右的宜盛寶，這類理財產品周期大約在壹年左右，進可攻退可守，就按照這樣的節奏積累幾年，也就是積累到了第壹桶金。當然，最關鍵的還是要努力工作，使自己具備更多的競爭力。<br />
&nbsp; &nbsp;二、攢夠了資本金，即使只有10%的成功可能，也要去做<br />
&nbsp; &nbsp;這句話的原話是來自馬斯克。“就像比爾·蓋茨先生所講到的，其實壹開始我沒有預想我要做這麽龐大的事情。只要這件事有10%的成功率，我就去做，現在做特斯拉也是這樣，我壹開始做電動車的時候，人們都勸我說，開汽車公司都是傻子，開電動汽車的公司是傻子中的戰鬥機，但我們依然沒有停止，依然嘗試了很多次。”<br />
&nbsp; &nbsp;三、精神世界的修為和資本的積累壹樣重要<br />
&nbsp; &nbsp;“人醜就要多讀書”嘉豐瑞德理財師認為，不醜也要多讀書。世界上多的是比妳美，還比妳更愛讀書的人，精神世界的層次決定了妳的層次。所謂人要往上爬就是這個道理，“土財主”之所以“土”，發了財還得不到尊敬，就是因為他精神層面所在的層次不足以支撐他的財富，所以說呢，提高精神層次的最直白的方式還是讀書，不管怎樣都要讀書，忙裏偷閑也要讀書，鑿壁借光、懸梁刺股都要讀書。<br />
&nbsp; &nbsp;四、學會創新，等待機遇<br />
&nbsp; &nbsp;大佬們其實也談了談具體業務，馬斯克說到他的無人駕駛汽車，說從技術角度來說，無人駕駛汽車兩到三年之後，就會比有人駕駛更安全；大規模量產的話，五年之後就可以實現。但要讓無人駕駛被主流人群接受，還必須有政府相關法規的支持。但是在此之前，這種蘊含著無限可能的技術依然會被不斷地改進。<br />
&nbsp; &nbsp;五、起得早，養成良好的習慣<br />
&nbsp; &nbsp;對話結束時，才不到早上八點半！有人就說了，世界上最可怕的事發生了，大佬們7點就開始聊未來了！其實大佬們的作息習慣都非常好，日子過得很有紀律性，不會賴床，不會晚上打遊戲到半夜，雖然胡適大師留下了“7月13日，打牌；7月14日，打牌…7月16日，胡適啊妳不能再墮落了；7月17日，打牌；7月18日，打牌”的日記，但是據嘉豐瑞德理財師實地翻開胡適日記考證，胡適大師打牌只是消遣，人家還是把該做的事情都做完了再去打牌的，囧。今日事今日畢，不能給拖延癥可趁之機。<br />
&nbsp; &nbsp;六、學會感恩和回饋<br />
&nbsp; &nbsp;嘉豐瑞德理財師認為，比爾蓋茨算是壹個格局非常大的人，知道力量越大責任越大，所以他能說出“當我在二十多歲的時候，應該不會因為做慈善而有多大的滿足感，畢竟那時候中國記得更多的是微軟本身，從現在這個階段來說，我覺得我可以做出最大的貢獻，都是通過慈善基金(微博)會來實現的。”<br />','','','','0','2015-04-09 20:46:50');/* MySQLReback Separation */
