 INSERT INTO `dd_indexnews` VALUES ('13','2','靠谱的投资理财“三三”定律','靠譜的投資理財“三三”定律','<strong>&nbsp; &nbsp;&nbsp;</strong><span style=\"color:#333333;font-family:宋体;font-size:16px;line-height:1.5;\">我们理财为的是让财富更快、更稳定的增值，可凡事也讲究一个规律，那理财的规律是如何呢？对此，国内知名理财机构嘉丰瑞德</span><span style=\"color:#333333;font-family:宋体;font-size:16px;line-height:1.5;\">通过长期观察和分析投资行为，特意总结了一些理财方面的“三三定律”。假如参考而做的话，相信会帮助你的财富能更好的成长。</span> 
<p style=\"color:#333333;font-family:宋体;font-size:16px;background-color:#FFFFFF;\">
	<span>　　</span><span>做到这三个</span> 
</p>
<p style=\"color:#333333;font-family:宋体;font-size:16px;background-color:#FFFFFF;\">
	<span>　　</span><span>1、做到节约</span> 
</p>
<p style=\"color:#333333;font-family:宋体;font-size:16px;background-color:#FFFFFF;\">
	<span>　　常常听到人抱怨没有可用于投资的钱。其实不然，注意节约、省钱的话，同样能拿得出资金用以投资。要想富裕，人们总得有个取舍，所以某些在花钱方面比较浪费和不太值得的，应主动舍弃，节约出资金用以进行投资和理财。</span> 
</p>
<p style=\"color:#333333;font-family:宋体;font-size:16px;background-color:#FFFFFF;\">
	<span>　　</span><span>2、做到计划</span> 
</p>
<p style=\"color:#333333;font-family:宋体;font-size:16px;background-color:#FFFFFF;\">
	<span>　　有了节约，即有了一定的资金。而有了资金，即可以做投资了。这时候需要考验如何规划投资。投资有很多种，可以考虑配比。比如偏稳健的国债、银行理财产品投资，以3年期的国债为例，收益大约是5%左右；而银行理财产品，如上海某一城商行的12个月投资期限的银行理财产品，年收益率在5.9%左右。此外投资风险也较低的固定收益类理财也不错，以宜盛财富发行的宜盛宝产品为例，年收益是9.6%；另外还有就是股市类的投资，风险比较大，但风险性收益也相当可观，做好股市的配比投资也是计划中相当重要的一部分。目前股市近期创出了几年来的新高，可以适当考虑。</span> 
</p>
<p>
	<br />
</p>
<p style=\"color:#333333;font-family:宋体;font-size:16px;background-color:#FFFFFF;\">
	<span>　　</span><span>3、做到向理性的接近</span> 
</p>
<p style=\"color:#333333;font-family:宋体;font-size:16px;background-color:#FFFFFF;\">
	<span>　　做到理性，这说起来容易做起来难。不过要是做到向理性靠近，这恐怕是可以做到的。嘉丰瑞德理财师认为，对于投资者来说，要避免大面积的投资失败，不应一味只追求高收益，也不要过于跟风散户去投资、以及不要过于集中投资是比较重要的原则。另外，投资者应合理的预期投资收益、理性的分配资金，最终才能帮助你较好的达成目标。</span> 
</p>
<p style=\"color:#333333;font-family:宋体;font-size:16px;background-color:#FFFFFF;\">
	<span>　　</span><span>修炼这三条</span> 
</p>
<p style=\"color:#333333;font-family:宋体;font-size:16px;background-color:#FFFFFF;\">
	<span>　　</span><span>1、知识的修炼</span> 
</p>
<p style=\"color:#333333;font-family:宋体;font-size:16px;background-color:#FFFFFF;\">
	<span>　　作为投资者，万万不可忽视对金融知识、投资知识的学习和积累，这对于专业机构来说也是一样。故嘉丰瑞德</span><span>理财师建议，平时可多了解财经和投资资讯，多方参考专业人士的意见。</span> 
</p>
<p style=\"color:#333333;font-family:宋体;font-size:16px;background-color:#FFFFFF;\">
	<span>　　</span><span>2、信息平衡的修炼</span> 
</p>
<p style=\"color:#333333;font-family:宋体;font-size:16px;background-color:#FFFFFF;\">
	<span>　　有些人特别相信某些机构的判断，或特别相信某些专家的判断。但是话说回来，机构或人，总归是会犯错。因此投资人需要修炼在做决策时做到在“信任“和“不信任”之间的平衡。总之对信息，投资者要有自己的判断能力。</span> 
</p>
<p style=\"color:#333333;font-family:宋体;font-size:16px;background-color:#FFFFFF;\">
	<span>　　</span><span>3、心态的修炼</span> 
</p>
<p style=\"color:#333333;font-family:宋体;font-size:16px;background-color:#FFFFFF;\">
	<span>　　我们做投资，最重要是实现财务</span><span>自由，进而过上更好的生活。而倘若做投资的你整日因为投资而诚惶诚恐，或忙得影响了工作，“连累”到其他的幸福，那则是不太可取的。投资把心态放稳，把握长远，细水长流更好。</span> 
</p>
<p style=\"color:#333333;font-family:宋体;font-size:16px;background-color:#FFFFFF;\">
	<span>　　总结了以上的“三个做到“和“三个修炼”，想必投资者对于投资可能也有了自己的一些看法。</span><img src=\"http://comment.10jqka.com.cn/sourcepic/12/vM634cjwtcItsay.png\" /><span>理财师认为，“三三定律”可能不能完全做到，但做到80%的话，那对投资还是会有相当大的帮助的。</span> 
</p>','    我們理財為的是讓財富更快、更穩定的增值，可凡事也講究壹個規律，那理財的規律是如何呢？對此，國內知名理財機構嘉豐瑞德通過長期觀察和分析投資行為，特意總結了壹些理財方面的“三三定律”。假如參考而做的話，相信會幫助妳的財富能更好的成長。<br />
　 做到這三個<br />
　 1、做到節約<br />
　 常常聽到人抱怨沒有可用於投資的錢。其實不然，註意節約、省錢的話，同樣能拿得出資金用以投資。要想富裕，人們總得有個取舍，所以某些在花錢方面比較浪費和不太值得的，應主動舍棄，節約出資金用以進行投資和理財。<br />
　 2、做到計劃<br />
　 有了節約，即有了壹定的資金。而有了資金，即可以做投資了。這時候需要考驗如何規劃投資。投資有很多種，可以考慮配比。比如偏穩健的國債、銀行理財產品投資，以3年期的國債為例，收益大約是5%左右；而銀行理財產品，如上海某壹城商行的12個月投資期限的銀行理財產品，年收益率在5.9%左右。此外投資風險也較低的固定收益類理財也不錯，以宜盛財富發行的宜盛寶產品為例，年收益是9.6%；另外還有就是股市類的投資，風險比較大，但風險性收益也相當可觀，做好股市的配比投資也是計劃中相當重要的壹部分。目前股市近期創出了幾年來的新高，可以適當考慮。<br />
　 3、做到向理性的接近<br />
　 做到理性，這說起來容易做起來難。不過要是做到向理性靠近，這恐怕是可以做到的。嘉豐瑞德理財師認為，對於投資者來說，要避免大面積的投資失敗，不應壹味只追求高收益，也不要過於跟風散戶去投資、以及不要過於集中投資是比較重要的原則。另外，投資者應合理的預期投資收益、理性的分配資金，最終才能幫助妳較好的達成目標。<br />
　 修煉這三條<br />
　 1、知識的修煉<br />
　 作為投資者，萬萬不可忽視對金融知識、投資知識的學習和積累，這對於專業機構來說也是壹樣。故嘉豐瑞德理財師建議，平時可多了解財經和投資資訊，多方參考專業人士的意見。<br />
　 2、信息平衡的修煉<br />
　 有些人特別相信某些機構的判斷，或特別相信某些專家的判斷。但是話說回來，機構或人，總歸是會犯錯。因此投資人需要修煉在做決策時做到在“信任“和“不信任”之間的平衡。總之對信息，投資者要有自己的判斷能力。<br />
　 3、心態的修煉<br />
　 我們做投資，最重要是實現財務自由，進而過上更好的生活。而倘若做投資的妳整日因為投資而誠惶誠恐，或忙得影響了工作，“連累”到其他的幸福，那則是不太可取的。投資把心態放穩，把握長遠，細水長流更好。<br />
　 總結了以上的“三個做到“和“三個修煉”，想必投資者對於投資可能也有了自己的壹些看法。理財師認為，“三三定律”可能不能完全做到，但做到80%的話，那對投資還是會有相當大的幫助的。<br />','','','','0','2015-04-09 20:53:46');/* MySQLReback Separation */
