 INSERT INTO `dd_indexnews` VALUES ('14','2','月光族必看的理财技巧','月光族必看的理財技巧','<p style=\"font-size:14px;font-family:微软雅黑, 宋体;background-color:#FFFFFF;\">
	       现在很多理财意识较强的工薪族想要理财，都是每月领到薪水，待日常生活消费后，再将剩余的钱存入银行。到头来，有些人却发现，由于自己无计划地消费，每月所能存入银行的钱非常少。现就就教大家三个理财公式，让你的小金库里的钱越来越多。
</p>
<p style=\"font-size:14px;font-family:微软雅黑, 宋体;background-color:#FFFFFF;\">
	　　公式一：支出=收入-储蓄
</p>
<p style=\"font-size:14px;font-family:微软雅黑, 宋体;background-color:#FFFFFF;\">
	　　每月先将30%的收入存入银行，剩下的钱用于当月消费资金。
</p>
<p style=\"font-size:14px;font-family:微软雅黑, 宋体;background-color:#FFFFFF;\">
	　　公式二：储蓄=50%保守理财+50%“稳攻”和“强攻”
</p>
<p style=\"font-size:14px;font-family:微软雅黑, 宋体;background-color:#FFFFFF;\">
	　　把50%的资金用于定存、投入货币基金或者购买银行保本理财产品等。剩余50%资金可进行“稳攻”和“强攻”，即25%可以购买一些风险低收益中等的理财产品，另外25%购买风险性高一些收益较高的理财产品。
</p>
<p style=\"font-size:14px;font-family:微软雅黑, 宋体;background-color:#FFFFFF;\">
	　　公式三：个人可承担风险比重=100-目前年龄
</p>
<p style=\"font-size:14px;font-family:微软雅黑, 宋体;background-color:#FFFFFF;\">
	　　个人可承担风险比重有公式可循，即个人可承担风险比重=100-目前年龄。比如包浩今年26岁，可承担风险比重为74(100-26)，那么可以将70%左右的闲置资金投入高风险高收益的投资。
</p>','&nbsp; &nbsp; 現在很多理財意識較強的工薪族想要理財，都是每月領到薪水，待日常生活消費後，再將剩余的錢存入銀行。到頭來，有些人卻發現，由於自己無計劃地消費，每月所能存入銀行的錢非常少。現就就教大家三個理財公式，讓妳的小金庫裏的錢越來越多。<br />
　　公式壹：支出=收入-儲蓄<br />
　　每月先將30%的收入存入銀行，剩下的錢用於當月消費資金。<br />
　　公式二：儲蓄=50%保守理財+50%“穩攻”和“強攻”<br />
　　把50%的資金用於定存、投入貨幣基金或者購買銀行保本理財產品等。剩余50%資金可進行“穩攻”和“強攻”，即25%可以購買壹些風險低收益中等的理財產品，另外25%購買風險性高壹些收益較高的理財產品。<br />
　　公式三：個人可承擔風險比重=100-目前年齡<br />
　　個人可承擔風險比重有公式可循，即個人可承擔風險比重=100-目前年齡。比如包浩今年26歲，可承擔風險比重為74(100-26)，那麽可以將70%左右的閑置資金投入高風險高收益的投資。<br />','','','','0','2015-04-09 21:01:07');/* MySQLReback Separation */
