 INSERT INTO `dd_indexnews` VALUES ('15','2','再不理财就晚了','再不理財就晚了：哪些理財陋習讓妳越理越窮','<p style=\"font-family:宋体, tahoma, arial, sans-serif;font-size:16px;background-color:#FFFFFF;\">
	&nbsp; &nbsp; 对于理财新手来说，常犯的错误便是搞错了理财的顺序。当前有很多人都是先投资，再准备生活备用金，然后投保，最后进行财产传承。然而理财师建议的正确顺序应当是先准备生活备用金，再进行保险规划，然后进行投资，最后才做财产的传承。顺序弄错了，很可能会影响你的理财规划和最终实现的效果。
</p>
<p style=\"font-family:宋体, tahoma, arial, sans-serif;font-size:16px;background-color:#FFFFFF;\">
	&nbsp; &nbsp; 许多理财新手，特别是年轻人，很容易抱有“我还年轻没财可理”、“有钱人才理财”等错误的观念。新手容易犯的另一个错误就是盲目跟风投资，并且只追逐高收益。刘女士就对记者说，当初才接触理财时，面对五花八门的投资工具难以抉择，只好跟着同事朋友购买，但同事朋友也不一定就是投资理财方面的专家，所以当时刘女士买过并不适合她的分红保险，也买过赔了几千元的基金。盲目跟风投资时，刘女士表示都是因为朋友推荐的产品收益听上去很吸引人，高过银行定存利率，有的宣传收益率在10%以上，但因为产品说明书很难看懂，没有细致研究过产品的她也就犯了追逐高收益而无视风险的错误。
</p>
<p style=\"font-family:宋体, tahoma, arial, sans-serif;font-size:16px;background-color:#FFFFFF;\">
	&nbsp; &nbsp; 对于理财新手来说，信用卡可谓是双刃剑。如市民唐先生就对记者说，因为不少信用卡推出了各种优惠活动，在工作人员的鼓动下他曾一度办了5张不同银行的信用卡。但这导致的结果就是多张信用卡造成了理财上的混乱，他搞混了各张卡的最后还款日期，优惠活动也不一定能够及时赶上。同时，多张信用卡也容易产生“拆东墙补西墙”的行为，导致频繁欠费，财富没有积聚效应也不容易得到任何一家银行的升级服务。不记得最后还款日还会导致逾期还款，这也是很多持卡人留下了信用记录灰点的原因。
</p>
<p style=\"font-family:宋体, tahoma, arial, sans-serif;font-size:16px;background-color:#FFFFFF;\">
	如何改进：
</p>
<p style=\"font-family:宋体, tahoma, arial, sans-serif;font-size:16px;background-color:#FFFFFF;\">
	&nbsp; &nbsp;&nbsp;如同旅行只要出发就成功了一半，理财也同样如此。银率网分析师潘涛认为，其实生活中的点滴都跟理财息息相关，今天买菜多少钱、坐公交多少钱、衣服多少钱等合理消费、理性购物也是理财。
</p>
<p style=\"font-family:宋体, tahoma, arial, sans-serif;font-size:16px;background-color:#FFFFFF;\">
	他提醒投资者，不能习以为常地进行盲目跟风投资。据此前的一份调查显示，有七成人购买银行理财产品前并没有阅读产品说明书，这表明盲目投资的行为仍普遍存在。潘涛建议，投资者需要做到对投资工具进行充分的了解，如了解资金投向、风险何在、本金是否能赎回等。
</p>
<p style=\"font-family:宋体, tahoma, arial, sans-serif;font-size:16px;background-color:#FFFFFF;\">
	&nbsp; &nbsp; 而对于高收益理财产品，他则建议首先可以货比三家，寻找自己风险承受能力之内的产品，然后再对产品的资金投向风险流动性等进行了解，最终根据自身的理财需求决定购买。信用卡则拥有1~2张就足够用了，不要因为贪图优惠而盲目开多张信用卡。
</p>
<p style=\"font-family:宋体, tahoma, arial, sans-serif;font-size:16px;background-color:#FFFFFF;\">
	“剁手族”：误把信用卡分期当免单
</p>
<p style=\"font-family:宋体, tahoma, arial, sans-serif;font-size:16px;background-color:#FFFFFF;\">
	&nbsp; &nbsp; 在理财过程中，容易冲动消费的“剁手族”无疑更容易犯更多的错误。市民小云就十分喜欢网购，总是看到网上的打折活动、产品包邮、电商的促销就进行冲动消费。几乎每个月她都会在网上淘到一些并不需要或者不符预期的东西，要退货又会产生新的运费。一年多下来，小云才意识到，原本以为网购划算，但其实花掉了不少不必要的钱。
</p>
<p style=\"font-family:宋体, tahoma, arial, sans-serif;font-size:16px;background-color:#FFFFFF;\">
	&nbsp; &nbsp; 这种贪小便宜的意识产生的损失也并不一定在网上发生，市民何女士对记者表示，过去曾经办过不少“健身卡”、“理发卡”，这些卡中都要预付费，但有时犯懒或者真的忘掉了以后，这笔资金也就此沉没，因不能提现反而产生了不少损失。譬如她曾经在朋友家附近办过一张半年一千元的瑜伽健身卡，但半年中她只有刚开卡的时候去过不到5次，后来因为各种原因都没有再去光顾，本来每次只要不到40元，结果变成了一次几百元，便宜没有享受到反而吃了不少亏。
</p>
<p style=\"font-family:宋体, tahoma, arial, sans-serif;font-size:16px;background-color:#FFFFFF;\">
	&nbsp; &nbsp;&nbsp;另一种理财上的陋习则是动不动就用信用卡分期付款来购买商品，特别在<span style=\"line-height:1.5;\">购买金额较高的产品时，分期付款可以让经济能力有限的“剁手族”提前实现购买愿望，但仔细观察这当中也有不少门道是“剁手族”们容易忽视的。首先是分期付款需要承担手续费，一般来说，12期的分期还款手续费为7%~8%左右，往往分期越多偿还的手续费越多。而那些号称零息零手续费的信用卡分期付款商品，其售价也往往比一次性购买的价格高。在大笔支出后，信用卡发卡行往往会致电持卡人，劝其进行分期，为了减少每月还款负担，很多人都会选择账单分期，而分期后的账单在进行还款时如果再按照最低还款额进行还款就是不可取的，但这一点并不被许多信用卡新人所熟知，且易产生逾期还款的不良记录。</span> 
</p>
<p style=\"font-family:宋体, tahoma, arial, sans-serif;font-size:16px;background-color:#FFFFFF;\">
	如何改进：
</p>
<p style=\"font-family:宋体, tahoma, arial, sans-serif;font-size:16px;background-color:#FFFFFF;\">
	&nbsp; &nbsp; 无计划、无节制地花钱习惯早已成为很多年轻人习以为常的行为，这也是多数人沦为月光族多年都攒不了钱的最主要原因。潘涛建议，个人和家庭制定一个账本认真记下每笔开支，时时总结哪方面的钱是不该花的，有效控制消费理性购物。而对于预付费卡，消费者则应该了解商户的经营资质，同时衡量自己的实际需求再进行购买。分期付款虽然可以在短期内减轻负担，但也应该量力而为。
</p>
<p style=\"font-family:宋体, tahoma, arial, sans-serif;font-size:16px;background-color:#FFFFFF;\">
	为人父母：不要带给孩子错误的理财示范
</p>
<p style=\"font-family:宋体, tahoma, arial, sans-serif;font-size:16px;background-color:#FFFFFF;\">
	&nbsp; &nbsp; 父母在生活中的一些错误理财示范也不利于子女的理财观念。譬如许多家庭对于孩子的需求总是有求必应，导致孩子不珍惜金钱也不懂得节制;而父母本身在花钱的时候也没有以身作则，教育孩子不要乱花钱的同时自己却花钱没有计划;时常为了钱争吵很容易让孩子产生“金钱是不好的东西”的观念;一些父母会答应孩子考试满分或达到某一目标时给予奖励，但如果没有兑现言行则容易给孩子带来不好的影响;而一些父母为了显示关爱孩子，容易带孩子去参加一些费用很高的游乐项目。
</p>
<p style=\"font-family:宋体, tahoma, arial, sans-serif;font-size:16px;background-color:#FFFFFF;\">
	如何改进：
</p>
<p style=\"font-family:宋体, tahoma, arial, sans-serif;font-size:16px;background-color:#FFFFFF;\">
	&nbsp; &nbsp;&nbsp;银率网分析师佐非建议，父母应该从小培养孩子的财商。可以从三个方面让孩子建立其健康的财商观念。一是树立正确理财观，培养孩子良好的理财习惯，父母可从日常生活教育着手，进行孩子的理财教育及观念培养;二是小钱成大钱，每个父母都会给孩子零花钱，将这些零散资金学会系统运用是教会孩子理财的重要一步，她建议父母可利用一些银行产品让孩子学会强制储蓄;三是学会钱生钱，可以利用银行的少儿理财产品从小培养孩子的赚钱意识和能力。此外父母还可采用定期发放零用钱的方式，鼓励孩子记小账本等措施，训练孩子的用钱能力。
</p>
<p>
	<br />
</p>','    對於理財新手來說，常犯的錯誤便是搞錯了理財的順序。當前有很多人都是先投資，再準備生活備用金，然後投保，最後進行財產傳承。然而理財師建議的正確順序應當是先準備生活備用金，再進行保險規劃，然後進行投資，最後才做財產的傳承。順序弄錯了，很可能會影響妳的理財規劃和最終實現的效果。<br />
　　許多理財新手，特別是年輕人，很容易抱有“我還年輕沒財可理”、“有錢人才理財”等錯誤的觀念。新手容易犯的另壹個錯誤就是盲目跟風投資，並且只追逐高收益。劉女士就對記者說，當初才接觸理財時，面對五花八門的投資工具難以抉擇，只好跟著同事朋友購買，但同事朋友也不壹定就是投資理財方面的專家，所以當時劉女士買過並不適合她的分紅保險，也買過賠了幾千元的基金。盲目跟風投資時，劉女士表示都是因為朋友推薦的產品收益聽上去很吸引人，高過銀行定存利率，有的宣傳收益率在10%以上，但因為產品說明書很難看懂，沒有細致研究過產品的她也就犯了追逐高收益而無視風險的錯誤。<br />
　　對於理財新手來說，信用卡可謂是雙刃劍。如市民唐先生就對記者說，因為不少信用卡推出了各種優惠活動，在工作人員的鼓動下他曾壹度辦了5張不同銀行的信用卡。但這導致的結果就是多張信用卡造成了理財上的混亂，他搞混了各張卡的最後還款日期，優惠活動也不壹定能夠及時趕上。同時，多張信用卡也容易產生“拆東墻補西墻”的行為，導致頻繁欠費，財富沒有積聚效應也不容易得到任何壹家銀行的升級服務。不記得最後還款日還會導致逾期還款，這也是很多持卡人留下了信用記錄灰點的原因。<br />
　　如何改進：<br />
　　如同旅行只要出發就成功了壹半，理財也同樣如此。銀率網分析師潘濤認為，其實生活中的點滴都跟理財息息相關，今天買菜多少錢、坐公交多少錢、衣服多少錢等合理消費、理性購物也是理財。<br />
　　他提醒投資者，不能習以為常地進行盲目跟風投資。據此前的壹份調查顯示，有七成人購買銀行理財產品前並沒有閱讀產品說明書，這表明盲目投資的行為仍普遍存在。潘濤建議，投資者需要做到對投資工具進行充分的了解，如了解資金投向、風險何在、本金是否能贖回等。<br />
　　而對於高收益理財產品，他則建議首先可以貨比三家，尋找自己風險承受能力之內的產品，然後再對產品的資金投向風險流動性等進行了解，最終根據自身的理財需求決定購買。信用卡則擁有1~2張就足夠用了，不要因為貪圖優惠而盲目開多張信用卡。<br />
　　“剁手族”：誤把信用卡分期當免單<br />
　　在理財過程中，容易沖動消費的“剁手族”無疑更容易犯更多的錯誤。市民小雲就十分喜歡網購，總是看到網上的打折活動、產品包郵、電商的促銷就進行沖動消費。幾乎每個月她都會在網上淘到壹些並不需要或者不符預期的東西，要退貨又會產生新的運費。壹年多下來，小雲才意識到，原本以為網購劃算，但其實花掉了不少不必要的錢。<br />
　　這種貪小便宜的意識產生的損失也並不壹定在網上發生，市民何女士對記者表示，過去曾經辦過不少“健身卡”、“理發卡”，這些卡中都要預付費，但有時犯懶或者真的忘掉了以後，這筆資金也就此沈沒，因不能提現反而產生了不少損失。譬如她曾經在朋友家附近辦過壹張半年壹千元的瑜伽健身卡，但半年中她只有剛開卡的時候去過不到5次，後來因為各種原因都沒有再去光顧，本來每次只要不到40元，結果變成了壹次幾百元，便宜沒有享受到反而吃了不少虧。<br />
另壹種理財上的陋習則是動不動就用信用卡分期付款來購買商品，特別在購買金額較高的產品時，分期付款可以讓經濟能力有限的“剁手族”提前實現購買願望，但仔細觀察這當中也有不少門道是“剁手族”們容易忽視的。首先是分期付款需要承擔手續費，壹般來說，12期的分期還款手續費為7%~8%左右，往往分期越多償還的手續費越多。而那些號稱零息零手續費的信用卡分期付款商品，其售價也往往比壹次性購買的價格高。在大筆支出後，信用卡發卡行往往會致電持卡人，勸其進行分期，為了減少每月還款負擔，很多人都會選擇賬單分期，而分期後的賬單在進行還款時如果再按照最低還款額進行還款就是不可取的，但這壹點並不被許多信用卡新人所熟知，且易產生逾期還款的不良記錄。<br />
　　如何改進：<br />
　　無計劃、無節制地花錢習慣早已成為很多年輕人習以為常的行為，這也是多數人淪為月光族多年都攢不了錢的最主要原因。潘濤建議，個人和家庭制定壹個賬本認真記下每筆開支，時時總結哪方面的錢是不該花的，有效控制消費理性購物。而對於預付費卡，消費者則應該了解商戶的經營資質，同時衡量自己的實際需求再進行購買。分期付款雖然可以在短期內減輕負擔，但也應該量力而為。<br />
　　為人父母：不要帶給孩子錯誤的理財示範<br />
　　父母在生活中的壹些錯誤理財示範也不利於子女的理財觀念。譬如許多家庭對於孩子的需求總是有求必應，導致孩子不珍惜金錢也不懂得節制;而父母本身在花錢的時候也沒有以身作則，教育孩子不要亂花錢的同時自己卻花錢沒有計劃;時常為了錢爭吵很容易讓孩子產生“金錢是不好的東西”的觀念;壹些父母會答應孩子考試滿分或達到某壹目標時給予獎勵，但如果沒有兌現言行則容易給孩子帶來不好的影響;而壹些父母為了顯示關愛孩子，容易帶孩子去參加壹些費用很高的遊樂項目。<br />
　　如何改進：<br />
　　銀率網分析師佐非建議，父母應該從小培養孩子的財商。可以從三個方面讓孩子建立其健康的財商觀念。壹是樹立正確理財觀，培養孩子良好的理財習慣，父母可從日常生活教育著手，進行孩子的理財教育及觀念培養;二是小錢成大錢，每個父母都會給孩子零花錢，將這些零散資金學會系統運用是教會孩子理財的重要壹步，她建議父母可利用壹些銀行產品讓孩子學會強制儲蓄;三是學會錢生錢，可以利用銀行的少兒理財產品從小培養孩子的賺錢意識和能力。此外父母還可采用定期發放零用錢的方式，鼓勵孩子記小賬本等措施，訓練孩子的用錢能力。<br />','','','','0','2015-09-01 23:50:46');/* MySQLReback Separation */
