 INSERT INTO `dd_indexview` VALUES ('3','新能源投资','新能源投資','<span style=\"font-size:12px;\"></span><span style=\"font-family:NSimSun;font-size:18px;\"><span style=\"font-size:12px;\"></span><span style=\"font-size:14px;\">&nbsp; &nbsp; 马来西亚顺丰风力发电有限公司（以下简称风电公司）成立於2007年2月，註册资金4亿元美币，是CRO投资以及马来西亚亚嘉隆泰集团合股之联营公司，专业从事风力发电相关业务，包括风力发电场的投资、建设、运营、维护、风电生產销售，提供风力发电规划、技术諮询及运行维护服务等。 </span></span><br />
<span style=\"font-family:NSimSun;font-size:14px;\">&nbsp; &nbsp; 顺丰将风电作為主业发展，从2003年开始涉足风电產业，参与东南亚风电特许权专案投标，2004年开始在东南亚各国开展风电专案前期工作、建设风电场。风电公司成立以后，顺丰集团在资金、技术、人才、管理等方面给予风电公司全方位的支持。 </span><br />
<span style=\"font-family:NSimSun;font-size:14px;\">&nbsp; &nbsp; 四年来，风电公司坚持“以点带面”的战略方针，在东南亚各国设立了5家分公司 和计画单列项目公司，以“陆海并举，陆上优先”的战略在沿海风带推进前期工作。目前已在马来西亚吉隆玻等地积极开展风电专案开发和工程建设,中标了马来西亚第一个最大的风电特许权项目―――马来西亚锡盟灰腾梁30万千瓦风电场；参加了第一个百万千瓦风电基地―――印尼风电基地的建设。截至2011年3月底，风电公司累计装机容量已超过128万千瓦，累计专案核准容量超过210万千瓦，在建专案容量达到120万千瓦，在运专案容量128万千瓦，累计拥有风资源储备3000万千瓦。现拥有总资產约100亿元美币，净资產值约90亿元美币，有效实现了集团资產的保值增值。</span><br />','&nbsp; &nbsp; 馬來西亞順豐風力發電有限公司（以下簡稱風電公司）成立於2007年2月，註冊資金4億元美幣，是萬盛投資以及馬來西亞亞嘉隆泰集團合股之聯營公司，專業從事風力發電相關業務，包括風力發電場的投資、建設、運營、維護、風電生產銷售，提供風力發電規劃、技術諮詢及運行維護服務等。 &nbsp;<br />
&nbsp; &nbsp; 順豐將風電作為主業發展，從2003年開始涉足風電產業，參與東南亞風電特許權專案投標，2004年開始在東南亞各國開展風電專案前期工作、建設風電場。風電公司成立以後，順豐集團在資金、技術、人才、管理等方面給予風電公司全方位的支持。 &nbsp;<br />
&nbsp; &nbsp; 四年來，風電公司堅持“以點帶面”的戰略方針，在東南亞各國設立了5家分公司和計畫單列項目公司，以“陸海並舉，陸上優先”的戰略在沿海風帶推進前期工作。目前已在馬來西亞吉隆玻等地積極開展風電專案開發和工程建設,中標了馬來西亞第壹個最大的風電特許權項目―――馬來西亞錫盟灰騰梁30萬千瓦風電場；參加了第壹個百萬千瓦風電基地―――印尼風電基地的建設。截至2011年3月底，風電公司累計裝機容量已超過128萬千瓦，累計專案核準容量超過210萬千瓦，在建專案容量達到120萬千瓦，在運專案容量128萬千瓦，累計擁有風資源儲備3000萬千瓦。現擁有總資產約100億元美幣，凈資產值約90億元美幣，有效實現了集團資產的保值增值。<br />','1441203274','','','','');/* MySQLReback Separation */
