 INSERT INTO `dd_indexview` VALUES ('4','国际金融','國際金融','<span style=\"font-size:12px;font-family:NSimSun;\"><span style=\"font-size:16px;\">&nbsp; &nbsp; 美国CRO投资集团有限公司是一家国际性综合金融服务机构，以国际经济大局势为依据，在全球范围开展业务。在集团公司综合金融服务宗旨的指导下，为国内外个人投资者和金融机构提供专业的理财服务。目前已在国际、国内金融市场建立广泛的客户基础。 </span><br />
<span style=\"font-size:16px;\">&nbsp; &nbsp; CRO投资集团全体同仁本著“诚信、合作、创新、进取”的企业精神，为金融市场投资客户提供投资谘询和交易指导，以提高金融市场投资者交易水淮，实现长期稳定盈利为己任。同时，万盛集团与国际、国内各类金融谘询公司紧密合作，在开拓市场、发展和维护客户方面交流经验，达到资讯共用、优势互补、共同促进金融市场的发展。</span><br />
</span><span style=\"font-size:12px;font-family:NSimSun;\"></span><br />','&nbsp; &nbsp; 香港萬盛投資集團有限公司是壹家國際性綜合金融服務機構，以國際經濟大局勢為依據，在全球範圍開展業務。在集團公司綜合金融服務宗旨的指導下，為國內外個人投資者和金融機構提供專業的理財服務。目前已在國際、國內金融市場建立廣泛的客戶基礎。&nbsp;<br />
&nbsp; &nbsp; 萬盛集團全體同仁本著“誠信、合作、創新、進取”的企業精神，為金融市場投資客戶提供投資諮詢和交易指導，以提高金融市場投資者交易水準，實現長期穩定盈利為己任。同時，萬盛集團與國際、國內各類金融諮詢公司緊密合作，在開拓市場、發展和維護客戶方面交流經驗，達到資訊共用、優勢互補、共同促進金融市場的發展。<br />
&nbsp;','1441119485','','','','');/* MySQLReback Separation */
