 INSERT INTO `dd_indexview` VALUES ('5','食品加工','食品加工','<span style=\"font-family:NSimSun;font-size:12px;\"><span style=\"font-size:16px;\">&nbsp; &nbsp; 美国CRO投资集团有限公司全资拥有美国粉岭肉製品深加工基地，该基地主要加工猪、牛、羊、家禽等肉类食品。 </span><br />
<span style=\"font-size:16px;\"> 集团拥有标准的食品加工环境和先进的肉类深加工设备，採用传统配方、现代化的生产工艺，将肉製品加工成润滑、爽口、香而不腻的熟食品（香肠、火腿、培根、肉斡、速食等），供应本港和海外市场。 </span><br />
<span style=\"font-size:16px;\">&nbsp; &nbsp; 集团严格检疫控制肉类来源和各种加工产品原料，加工流水线严格按照卫生食品行业执行标准进行控制维护，加工出来的产品符合国家卫生标准与各项检测，在各大商场生鲜超市均有销售</span>。 </span><br />','<span style=\"font-family:NSimSun;font-size:18px;\"><span style=\"font-family:NSimSun;font-size:12px;\">&nbsp; &nbsp; 香港萬盛投資集團有限公司全資擁有香港粉嶺肉製品深加工基地，該基地主要加工豬、牛、羊、家禽等肉類食品。&nbsp;</span><br />
<span style=\"font-family:NSimSun;font-size:12px;\">&nbsp; &nbsp; 集團擁有標準的食品加工環境和先進的肉類深加工設備，採用傳統配方、現代化的生產工藝，將肉製品加工成潤滑、爽口、香而不膩的熟食品（香腸、火腿、培根、肉斡、速食等），供應本港和海外市場。&nbsp;</span><br />
<span style=\"font-family:NSimSun;font-size:12px;\">&nbsp; &nbsp; 集團嚴格檢疫控制肉類來源和各種加工產品原料，加工流水線嚴格按照衛生食品行業執行標準進行控制維護，加工出來的產品符合國家衛生標準與各項檢測，在各大商場生鮮超市均有銷售。&nbsp;</span></span> <br />','1441122254','','','',''),('6','工业园区开发','工業園區開發','<span style=\"font-family:NSimSun;font-size:16px;\">&nbsp; &nbsp; 美国CRO投资集团有限公司已形成有土地一级开发、房地产开发经营、市政公用、多元化服务四项主要经营业务，其中又以工业园区开发为重中之重。&nbsp;<br />
&nbsp; &nbsp; 土地一级开发包括乙天顺生态科技城专案为代表的综合开发，房地产开发与经营包括以本部为代表的工业房产和乙天顺置地为代表的住宅房产业务，公用事业包括乙天顺公用为代表的市政、水务、电力、燃气等业务，多元化服务主要包括招商代理、工程代理、国际教育和物业管理等业务。<br />
</span><span style=\"font-family:NSimSun;font-size:16px;\"></span><br />','<span style=\"font-family:NSimSun;\">&nbsp; &nbsp; 香港萬盛投資集團有限公司已形成有土地壹級開發、房地產開發經營、市政公用、多元化服務四項主要經營業務，其中又以工業園區開發為重中之重。&nbsp;<br />
&nbsp; &nbsp; 土地壹級開發包括乙天順生態科技城專案為代表的綜合開發，房地產開發與經營包括以本部為代表的工業房產和乙天順置地為代表的住宅房產業務，公用事業包括乙天順公用為代表的市政、水務、電力、燃氣等業務，多元化服務主要包括招商代理、工程代理、國際教育和物業管理等業務。&nbsp;</span><br />','1441119927','','','','');/* MySQLReback Separation */
