 INSERT INTO `dd_indexview` VALUES ('7','休闲娱乐','休閒娛樂','<span style=\"font-size:12px;font-family:NSimSun;\"><span style=\"font-size:16px;\">&nbsp; &nbsp; 美国CRO投资集团有限公司投资2.8亿美元，在印尼雅加达市沽打商业中心城区建设CRO隆商业摩登主题广场，并引进商业服务全新理念，打造雅加达最好、规模最大、功能最全面的商业中心。 </span><br />
<span style=\"font-size:16px;\">&nbsp; &nbsp; 总建筑面积22万平方米的CRO隆摩登主题广场将全部採用当今世界最先进的SHOPPINGGMALL模式——集百货、饮食、娱乐、休閒、商务宾馆、高档公寓于一体开发建设，商业配套将演绎“品味生活、休閒娱乐”的理念，让消费成为“品味生活”。 </span><br />
<span style=\"font-size:16px;\">&nbsp; &nbsp; 建成的商业主题广场不仅是购物天堂，而且是享受、观光、娱乐、休閒的综合场所。这里有世界著名品牌专卖区、流行、时尚服饰品牌的室内商业街，以中高档日用品为主的超市大卖场，东南亚知名餐饮企业组成的大型饮食娱乐广场，以及多家娱乐公司合作建设的大型室内公园，以数码影像城、游泳馆、真冰场及运动服饰为主的运动休閒广场，有知名品牌合作经营的家居广场、有商务、住宿、会务、展览中心为一体的星级宾馆。 </span></span><br />','&nbsp; &nbsp; 香港萬盛投資集團有限公司投資2.8億美元，在印尼雅加達市沽打商業中心城區建設萬盛隆商業摩登主題廣場，並引進商業服務全新理念，打造雅加達最好、規模最大、功能最全面的商業中心。 &nbsp;<br />
&nbsp; &nbsp; 總建築面積22萬平方米的萬盛隆摩登主題廣場將全部採用當今世界最先進的SHOPPINGGMALL模式——集百貨、飲食、娛樂、休閒、商務賓館、高檔公寓於壹體開發建設，商業配套將演繹“品味生活、休閒娛樂”的理念，讓消費成為“品味生活”。&nbsp;<br />
&nbsp; &nbsp; 建成的商業主題廣場不僅是購物天堂，而且是享受、觀光、娛樂、休閒的綜合場所。這裏有世界著名品牌專賣區、流行、時尚服飾品牌的室內商業街，以中高檔日用品為主的超市大賣場，東南亞知名餐飲企業組成的大型飲食娛樂廣場，以及多家娛樂公司合作建設的大型室內公園，以數碼影像城、遊泳館、真冰場及運動服飾為主的運動休閒廣場，有知名品牌合作經營的家居廣場、有商務、住宿、會務、展覽中心為壹體的星級賓館。&nbsp;<br />','1441119815','','','','');/* MySQLReback Separation */
