<br />
<span style=\"font-family:NSimSun;font-size:12px;\"> 誠實：以誠實的態度做產品；以誠實的態度做銷售；以誠實的態度作企業 </span><br />
<br />
<span style=\"font-family:NSimSun;font-size:12px;\"> 關愛：關愛顧客，努力滿足顧客需求；關愛員工，不斷改善員工工作環境、福利待遇 </span><br />
<br />
<span style=\"font-family:NSimSun;font-size:12px;\"> 秉承“客戶是我們最珍貴的合作夥伴”的服務理念，與廣大客戶共贏市場 </span><br />
