<br />
<span style=\"font-family:NSimSun;font-size:12px;\"> 顧客是衣食父母，企業的一切經營活動均圍繞顧客價值要求這一中心展開，把滿足顧客需求作為一切工作的目標和中心。企業內部的各部門都直接直面顧客，使各個環節逐步環化。 </span><br />','1441120033','','','',''),('10','联系我们','聯繫我們','<p style=\"color:#000000;text-indent:0px;background-color:#FFFFFF;\">
