 INSERT INTO `dd_indexview` VALUES ('11','董事长致词','','<p>
	<span style=\"font-size:16px;\">&nbsp; &nbsp; 在经济一体化的国际大环境中，资本运作的重要性更加凸显，如何把握资本运作的脉络，适应企业新的管理流程再造，</span><br />
<span style=\"font-size:16px;\">&nbsp; &nbsp; 帮助资本所有者抓住市场机遇，实现资本的保值、增值，这是新型的全能投资公司面临的首要任务。市场呼唤具有良好</span><span style=\"font-size:16px;\">资产管理理念和资本运作的优秀公司。我们正是在这样的环境下诞生的。在过去的几年里，CRO投资集团已与国内外</span><span style=\"font-size:16px;\">多家财团友好协作，并取得了瞩目的成就。我们力求协助企业整合优化资源，以合理的成本在充分开发和利用现有资</span><span style=\"font-size:16px;\">源的情况下，实现企业经营利益最大化。</span><br />
<span style=\"font-size:16px;\">&nbsp; &nbsp; “智有我天地、见证石成金”是我们的不懈追求，也是我们为企业、为社会服务、共用双赢的最终目标。我们的核心竞争力</span><span style=\"font-size:16px;\">在于拥有独特的行销网路和社会资本，拥有专业的研发顾问团队，拥有多年的管理经验和丰富的专业谘询服务，拥有精诚合作的团队精神，</span><span style=\"font-size:16px;\">拥有积极向上的工作态度。更重要的是，我们拥有一颗为企业服务的真诚的心。CRO投资集团愿意与国内外各界朋友精诚合作、共谋发展、</span><span style=\"font-size:16px;\">共用双赢，在日趋激烈的国际竞争氛围中积极拓展、共攀高峰，推展全球经济一体化进程！</span> 
</p>
