 INSERT INTO `dd_indexview` VALUES ('12','天老总','','公司准备筹划即将开业，开业期间，收款100万&nbsp;','','1441207326','','','',''),('13','投资项目','','464652463262','','1441207806','','','',''),('14','关于我们','','<p class=\"MsoNormal\" style=\"color:#333333;font-family:宋体, tahoma, Srial, helvetica, sans-serif;\">
	<span style=\"line-height:1.5;font-size:16px;\">美国</span><span style=\"line-height:1.5;font-size:16px;\">CRO</span><span style=\"line-height:1.5;font-size:16px;\">投资集团创立于</span><span style=\"line-height:1.5;font-size:16px;\">1986</span><span style=\"line-height:1.5;\"><span style=\"font-size:16px;\">年。位于美国圣地亚哥商业中心，是向快速成长的公司提供私募股权和风险投资的投资者。&nbsp;自公司成立以来，CRO已募集大约150 亿美元资金，并向 380 多家跨行业的公司提供成长资金、资本重组和管理层收购。这些公司中至今已有&nbsp;超过130 家公开上市，有 135 多家完成战略并购。</span><span style=\"line-height:1.5;font-size:16px;\">总部设立在美国西部最大的金融中心旧金山，在美国的波士顿、硅谷、英国.&nbsp;伦敦&nbsp;东京和圣保罗设计有办事处。是一家具有全球视野和实力的大型投资集团公司</span></span>
</p>
<p class=\"MsoNormal\" style=\"color:#333333;font-family:宋体, tahoma, Srial, helvetica, sans-serif;\">
	<span style=\"line-height:1.5;font-size:16px;\">&nbsp; &nbsp; 美国</span><span style=\"line-height:1.5;font-size:16px;\">CRO</span><span style=\"line-height:1.5;font-size:16px;\">投资集团是集投资、融资、能源资源、商业服务、信息技术和服务、消费品、教育、金融科技和服务、医药医疗、工业、互联网、新媒体、以及软件、国际贸易及高新技术开发于一体的多功能、多元化的跨国性资本营运机构。拥有国际资本市场运作的丰富经验，聚集了一批在行业、技术、管理、财务、法律等方面的专家实行管理与运作。</span>
</p>
<p class=\"MsoNormal\" style=\"color:#333333;font-family:宋体, tahoma, Srial, helvetica, sans-serif;\">
	<span style=\"font-size:16px;\">&nbsp; &nbsp; CRO</span><span style=\"font-size:16px;\">集团资金实力雄厚，恪守诚信、注重时效，并与大陆有关部门、国际高层金融机构和美国的基金会、财团、银行等建立了良好的金融关系。目前已与北美、南美、澳洲、中东、南非、亚洲、欧盟等多个国家和地区的企业建立了合资机构、和金融合作关系，并取得了非常可观的经济效益，公司在世界许多地区设有代表处而建立了比较广泛的经贸、高新技术开发的管理体系网路。</span>
</p>
<div>
	<br />
</div>','','1441208434','','','','');/* MySQLReback Separation */
