 INSERT INTO `dd_news` VALUES ('6','0','完善个人信息的重要通告','','<p class=\"MsoNormal\" align=\"left\">
	<span style=\"font-size:12pt;font-family:宋体;\">尊敬的Accoin矿主：</span> 
</p>
<p class=\"MsoNormal\" align=\"left\" style=\"text-indent:30pt;\">
	<span style=\"font-size:12pt;font-family:宋体;\">大家好！Accoin系统在内部注册试运营期间，这里我代表Accoin运营团队感谢大家的支持与理解，在这Accoin内部运营过程中我们收到了很多矿主的建议及意见，在这里我们感谢大家的反馈，Accoin技术团队已经收集整理了相关的建议正在开始做相应的优化与调整。为此需要所有矿主配合，按下面的通告内容完善相应的信息：</span> 
</p>
<p class=\"MsoNormal\" align=\"left\" style=\"text-indent:42pt;\">
	<span style=\"font-size:12pt;font-family:宋体;\">1</span><span style=\"font-size:12pt;font-family:宋体;\">：为了保障会员账户信息的安全与CT市场交易安全，系统郑重提醒大家一定在信息中心修改个人姓名的功能，矿主将不能自主修改名字，请所有矿主相互通知务必于指定的日期前修改正确的姓名，手机号码，邮箱账号，一旦关闭修改功能，系统将不再开放，如果后期有修改姓名的要求将被视为转让账户，我们将严格审核账户所有权，并且每次转让将需要扣除200CT币。确保正确的名字是为了所有矿主的安全利益与CT市场交易诚信机制构建。</span> 
</p>
<p class=\"MsoNormal\" align=\"left\" style=\"text-indent:42pt;\">
	<span style=\"font-size:12pt;font-family:宋体;\">2</span><span style=\"font-size:12pt;font-family:宋体;\">：为了配合密码找回功能的正常使用，现在请所有矿主完善密保信息：密保问题设置，这三个问题信息将作为找回密码的必须验证条件！只有这三个信息是正确无误的才能确保找回密码功能可用！为了您的账户安全，请所有矿主务必尽快完善您的上述信息！</span> 
</p>
<p class=\"MsoNormal\" align=\"left\" style=\"text-indent:42pt;\">
	<span style=\"font-size:12pt;font-family:宋体;\">3</span><span style=\"font-size:12pt;font-family:宋体;\">：为了塑造一个安全、诚信、流畅的CT交易市场环境，请所有矿主必须在提交CT出售挂单前，详细检查是否已经正确填写了您的收款账户信息，必须填写的信息为：手机号码，正确真实的银行信息、并开通短信提醒服务！只有在确认正确填写上述信息的情况下才可以提交CT出售挂单！如果没有正确填写收款信息，不光会导致你的挂单对方无法支付钱给你，同时也会导致买方无法支付，影响CT交易市场的正常运作！我们也将会在近期正对CT市场的交易流程进行优化！确保CT市场的交易快捷、安全、高效率！</span> 
